                        <img src={prod.image} alt={prod.title}/>
                    </div> 
                </div>
            </div>
            <div className="aem-GridColumn aem-GridColumn--default--6 aem-GridColumn--phone--12 aem-GridColumn--tablet--12">

            </div>
            </>
                );
            })
        }
        

        </section>
    );
}
